javascript.javascriptGenerator.minecraft_jsonParse = function (block) {
    var string = block.getField("string") ? String(Number(block.getFieldValue("server_string"))) : javascript.javascriptGenerator.valueToCode(block, "server_string", javascript.javascriptGenerator.ORDER_ASSIGNMENT) || "0";
    var type = block.getFieldValue('type');
    if(type==="drone" || type==="player" || type==="botNearBlock") {
        var data = block.getFieldValue('data');
    }
    else {
        var data =  block.getField("data") ? String(Number(block.getFieldValue("data"))) : javascript.javascriptGenerator.valueToCode(block, "data", javascript.javascriptGenerator.ORDER_ASSIGNMENT) || "0"   ;
    }
    var server_data = javascript.javascriptGenerator.nameDB_.getName(block.getFieldValue('server_data'), blockly.VARIABLE_CATEGORY_NAME);
    //data = data.replace("'","").replace("'","");
    //var code = server_data+'='+string+'.'+type+'.'+data+';';
    if(type==="block" || type==="entity")
        var code = server_data+'='+string+'[\''+type+'\'];\n';
    else
        var code = server_data+'='+string+'[\''+type+'\'][\''+data+'\'];\n';
    return code;
};

